import { Form, Input, Button } from "antd";
import Link from "next/link";

const layout = {
  labelCol: {
    span: 8,
  },
  wrapperCol: {
    span: 16,
  },
};
const tailLayout = {
  wrapperCol: {
    offset: 8,
    span: 16,
  },
};

const LoginForm = () => {
  return (
    <>
      <Form {...layout}>
        <Form.Item
          label="아이디"
          name="user-id"
          rules={[
            {
              required: true,
              message: "아이디를 입력해주세요!",
            },
          ]}
        >
          <Input />
        </Form.Item>
        <Form.Item
          label="비밀번호"
          name="user-password"
          rules={[
            {
              required: true,
              message: "비밀번호를 입력해주세요!",
            },
          ]}
        >
          <Input.Password />
        </Form.Item>
        <Form.Item {...tailLayout}>
          <Button type="primary" htmlType="submit">
            로그인
          </Button>

          <Link href="/signup">
            <a>
              <Button type="primary">회원가입</Button>
            </a>
          </Link>
        </Form.Item>
      </Form>
    </>
  );
};

export default LoginForm;
